import React from 'react';
import Greet from './Greet'

function GreetHello (){
    return(
        <div>
            <Greet name = "Marcus"></Greet>
            <Greet name = "Jeremy"></Greet>
            <Greet name = "Mallari"></Greet>
            <Greet name = "Carino"></Greet>
        </div>
    );
}
export default GreetHello;
